const Wordcloud=()=>{

        return (
            <div className='wordcloud'>
            <div className='imagem'>
                <img src={Gif} alt="O banner"/>
            </div>
            <div className='form'>
                <Form />
            </div>
            </div>
        )
}
 export default Wordcloud
